$_MODULE['<{supercheckout}prestashop>supercheckout_dc72e0ed0f63106d79f8e597023ec780'] = "Standardmäßig ist es nicht möglich, in unserem Modul ein benutzerdefiniertes Feld hinzuzufügen. Wenn Sie dies wünschen, können wir diese benutzerdefinierte Änderung für Sie für zusätzliche Kosten vornehmen. Bitte kontaktieren Sie uns mit Ihren vollständigen Anforderungen.";
